async function fetchUser(){var e=await fetch("https://dummyjson.com/users/1");user=await e.json(),console.log(user);document.getElementById("profilePhoto").src=user.image;var e=document.getElementById("firstName"),n=document.getElementById("lastName");e.innerHTML=user.firstName,n.innerHTML=user.lastName,document.getElementById("jobTitle").innerHTML=user.company.department,document.getElementById("jobAdress").innerHTML=user.company.address.address+" <br> "+user.company.address.city,document.getElementById("userEmail").innerHTML=user.email,document.getElementById("userPhone").innerHTML=user.phone,document.getElementById("companyPhone").innerHTML=user.ein}fetchUser();